Input: At breakfast, lunch, and dinner, Joe randomly chooses with equal probabilities either an apple, an orange, or a banana to eat. On a given day, what is the probability that Joe will eat at least two different kinds of fruit? Choices: a) \\frac{7}{9} b) \\frac{8}{9} c) \\frac{5}{9} d) \\frac{9}{11} 
Output:
First, I need to find the probability that Joe will eat only one kind of fruit. There are three ways this can happen: he eats only apples, only oranges, or only bananas. The probability of each of these events is (1/3) * (1/3) * (1/3) = 1/27, since there are three choices for each meal and each choice has a probability of 1/3.
The probability that Joe eats only one kind of fruit is 3 * (1/27) = 1/9.
Now, I need to find the probability that Joe eats at least two different kinds of fruit. This is equal to 1 minus the probability that he eats only one kind of fruit: 1 - 1/9 = 8/9.
Therefore, the correct answer is {'sol': 'b'}

Input: An ant crawls straight from $(-4,6)$ to the origin, and then continues straight on to $(4,3)$. How far does it travel? Choices: a) 16 b) 2\\sqrt{2} c) 5 d) 5+2\\sqrt{13} 
Output:
First, I need to find the distance from (-4,6) to the origin. The distance formula is sqrt((x2-x1)^2 + (y2-y1)^2). In this case, x2 = 0, y2 = 0, x1 = -4, and y1 = 6. So the distance is sqrt((0-(-4))^2 + (0-6)^2) = sqrt(16 + 36) = sqrt(52) = 2*sqrt(13).
Next, I need to find the distance from the origin to (4,3). Using the same distance formula, x2 = 4, y2 = 3, x1 = 0, and y1 = 0. So the distance is sqrt((4-0)^2 + (3-0)^2) = sqrt(16 + 9) = sqrt(25) = 5.
The total distance traveled is the sum of the two distances: 2*sqrt(13) + 5.
Therefore, the correct answer is {'sol': 'd'}

Input: Express as a common fraction the reciprocal of $0.\overline7$. Choices: a) \\frac{7}{2} b) \\frac{7}{9} c) \\frac{9}{2} d) \\frac{9}{7} 
Output:
First, I need to express the repeating decimal $0.\overline7$ as a fraction. Let x = 0.\overline7. Then, 10x = 7.\overline7. Subtracting the first equation from the second, we get 9x = 7, so x = 7/9.
Now, I need to find the reciprocal of 7/9. The reciprocal of a fraction is obtained by swapping the numerator and the denominator, so the reciprocal of 7/9 is 9/7.
Therefore, the correct answer is {'sol': 'd'}

Input: 3 cards are chosen at random from a standard 52-card deck. What is the probability that they form a pair? (A 3-card hand is a 'pair' if two of the cards match in rank but the third card is different. For example, 668 is a pair, but 999 is not.) Choices: a) \\frac{1}{8} b) \\frac{1}{36} c) \\frac{1}{78} d) \\frac{72}{425} 
Output:
First, I need to calculate the total number of possible 3-card hands. This is given by the combination formula: C(52, 3) = 52! / (3! * (52-3)!) = 22,100.
Next, I need to calculate the number of 3-card hands that form a pair. To do this, I need to choose the rank of the pair, which can be done in C(13, 1) = 13 ways. Then, I need to choose 2 cards of that rank, which can be done in C(4, 2) = 6 ways. Finally, I need to choose the third card, which can be done in C(48, 1) = 48 ways. Therefore, the total number of 3-card hands that form a pair is 13 * 6 * 48 = 3,744.
Now, I need to calculate the probability of forming a pair. This is given by the number of 3-card hands that form a pair divided by the total number of possible 3-card hands: 3,744 / 22,100 = 72 / 425.
Therefore, the correct answer is {'sol': 'd'}

Input: Five years ago, a computer that worked half as fast as a current computer cost twice as much money. The current computer's speed to price ratio is what percent of the older computer's speed to price ratio? Choices: a) 20 b) 400 c) 32 d) \\frac{2}{5} 
Output:
First, I need to define the variables. Let's say the current computer's speed is S and its price is P. Then, the older computer's speed is S/2 and its price is 2P.
Next, I need to calculate the speed to price ratio for the current computer and the older computer. The current computer's speed to price ratio is S/P. The older computer's speed to price ratio is (S/2)/(2P) = S/4P.
Now, I need to find the percentage of the current computer's speed to price ratio compared to the older computer's speed to price ratio. To do this, I divide the current computer's speed to price ratio by the older computer's speed to price ratio and multiply by 100: (S/P) / (S/4P) * 100 = 400%.
Therefore, the correct answer is {'sol': 'b'}

Input: Alex needs to borrow $\$10,\!000$ from the bank. The bank gives him two options. 1. A ten-year loan with an annual interest rate of $10\%$ compounded quarterly, with the condition that at the end of 5 years, Alex must make a payment equal to half of what he owes. The other half continues to accrue interest, and at the end of the ten years, Alex will pay off the remaining balance. 2. A ten-year loan with a simple annual interest rate of $12\%$, with just one lump-sum payment at the end of the ten years. Find the positive difference between the total amounts Alex has to pay back under the two schemes. Round your answer to the nearest dollar. Choices: a) 16401 b) 16400 c) 382 d) 383 
Output:
First, I need to calculate the amount owed after 5 years for the compounded interest option. The formula for compound interest is A = P(1 + r/n)^(nt), where A is the amount after t years, P is the principal amount, r is the annual interest rate, n is the number of times compounded in a year, and t is the time in years. In this case, P = $\$10,\!000$, r = 0.1, n = 4, and t = 5. Plugging these values into the formula, I get A = 10000(1 + 0.1/4)^(4*5) = 10000(1 + 0.025)^20 = 10000(1.025)^20 ≈ 16386.16. Since Alex must pay half of this amount, he will pay 16386.16/2 = 8193.08 after 5 years. The remaining half of 16386.16 continues to accrue interest for the next 5 years. To find the amount owed after 5 more years, I use the same formula with P = 16386.16, r = 0.1, n = 4, and t = 5. Plugging these values into the formula, I get A = 16386.16(1 + 0.1/4)^(4*5) = 16386.16(1 + 0.025)^20 = 16386.16(1.025)^20 ≈ 16845.32. Therefore, the total amount Alex has to pay back under the compounded interest option is 8193.08 + 16845.32 = 24638.40. Next, I need to calculate the amount owed after 10 years for the simple interest option. The formula for simple interest is A = P(1 + rt), where A is the amount after t years, P is the principal amount, r is the annual interest rate, and t is the time in years. In this case, P = $\$10,\!000$, r = 0.12, and t = 10. Plugging these values into the formula, I get A = 10000(1 + 0.12*10) = 10000(1 + 1.2) = 10000(2.2) = 22000. Therefore, the total amount Alex has to pay back under the simple interest option is 22000. The positive difference between the total amounts Alex has to pay back under the two schemes is 22000 - 24638.40 = -2628.40. However, the question asks for the positive difference, so I take the absolute value of -2628.40, which is 2628.40. Rounding this to the nearest dollar gives 2629. Therefore, the correct answer is {'sol': 'd'}
